<?php

namespace Database\Seeders;

use Illuminate\Database\Seeder;
use App\Models\User;
use App\Models\Playlist;

class TestdatenSeeder extends Seeder
{
    public function run()
    {
        // Benutzer erstellen
        $user = User::factory()->create();
        
        // Playlist mit Cover erstellen
        $cover = '';
        $playlistMitCover = Playlist::factory()->create([
            'name' => 'Playlist mit Cover',
            'cover_path' => $cover,
        ]);
        
        // Playlist ohne Cover erstellen
        $playlistOhneCover = Playlist::factory()->create([
            'name' => 'Playlist ohne Cover',
            'cover_path' => null,
        ]);
        
        // Benutzer Playlisten zuweisen
        $user->playlists()->attach([$playlistMitCover->id, $playlistOhneCover->id]);
    }
}
